  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0118791 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). USF collected the data from their in-situ moored station named shp in the
  Coastal Waters of Florida and North Atlantic Ocean. SECOORA, which assembles data
  from USF and other sub-regional coastal and ocean observing systems of the southeast
  United States, submitted the data to NODC as part of NODC's Integrated Ocean Observing
  System Data Assembly Centers (IOOS DACs) Data Stewardship Program. Each month, NODC
  adds to the Accession the data collected during the previous month.\",\n\t\"owner_org\":
